import React from 'react';
import RecentWork from '../../RecentWork';
import Welcome from '../../Welcome';
import Work from '../../Work';
import {homeObjOne, recentWorkObj} from './Data';


function Home() {
    return (
        <>
            <Welcome {...homeObjOne} />
            <RecentWork {...recentWorkObj} />
            

        </>
    );
}

export default Home;
